import React from "react";
function Download()
{
    return(
        <div>
       <div className="download">
        <div className="container">
            <div className="row justify-content-center d-flex align-items-center text-center">
                <div className="col-md-12">
                    <h3>
                        Stop waiting.<br/>
                        Start building.
                    </h3>
                    <button className="btn btn-outline-danger">DownLoad For Free</button>
                </div>
            </div>
        </div>
    </div>
        </div>
    )
}
export default Download;
